import React from 'react';
import './navbar.css';
import logo from '../../assets/logo.png';
import contactImg from '../../assets/th (5).png'
import {Link} from 'react-scroll';

const Navbar = () => {
    return(
       <nav className='navbar'>
        <img src={logo} alt="logo" className='logo'/>
        
        <div className='desktopMenu'>
        <Link to="home" smooth={true} duration={500} className='link desktopMenuListItem'>Home</Link>
          <Link to="about" smooth={true} duration={500} className='link desktopMenuListItem'>About</Link>
          <Link to="portfolio" smooth={true} duration={500} className='link desktopMenuListItem'>Portfolio</Link>
          <Link to="clients" smooth={true} duration={500} className='link desktopMenuListItem'>Clients</Link>
        </div>
         
    
       <button className='desktopMenuBtn' onClick ={() => {
        document.getElementById('contact').scrollIntoView();
       }}>
        <img src={contactImg} alt='Contact icon' className='desktopMenuImg'/>Contact Me</button>
       </nav>
    );
}

export default Navbar
